script: |
  super -f text -I q3555.spq | sort > q3555.out

inputs:
  - name: q3555.spq
    data: |
      SELECT DISTINCT + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT ( col1 * + col1 * - col1 ) IN ( - col2 / - col0 - col0 * - col2 );
  - name: tab0

outputs:
  - name: q3555.out
    data: |
      86
      91
      97
